(8, 8, '2019-01-17 09:21:34', 1, '2019-01-17 09:21:36', 1, NULL, 'apple_macbook_pro_15inc_2013_sonu_core_i7_256_ssd_8gb_ram', '<p></p><p><b>Apple Macbook Pro 15inc 2013 Sonu - Core i7 - 256 SSD - 8GB RAM</b>\r\n</p>\r\n<p><b>Seri Numara:</b>&nbsp;C02MJ36GFD56</p>\r\n<p><b>Model Numarası:</b>&nbsp;A1398 EMC 2674</p>\r\n<p>Orjinal Kutusu ile beraber verilecektir, Fatura mevcut değil.</p>\r\n<p>Türkiyeden satın alınmıştır, Türkçe Q Klavye.</p>\r\n<p>Orjinal şarj cihazı ve Magic Mouse 1 ile beraber teslim edilecektir. (Mouse un alt bölümünde deforme vardır resimlerde belirtilmiştir.)</p>\r\n<p>Kozmetik olarak çok iyi durumda belirgin çizik veya darbe izi yoktur. Hiçbir teknik servis işlemi görmemiştir.</p>\r\n<p><b>İşlemci:</b>&nbsp;Intel Core i7 2.0 GHz. (i7-4750HQ) - Turbo Boost 3.2 GHz.</p>\r\n<p><b>Hard Disk:</b>&nbsp;256 GB Flaş Depolama Alanı SSD</p>\r\n<p><b>RAM:</b>&nbsp;8 GB 1600 MHz DDR3 (4x2 Slot)</p>\r\n<p><b>Pil Devir Sayısı:</b>&nbsp;365</p>\r\n<p><b>Ekran Kartı:</b>&nbsp;Intel Iris Pro 1536 MB</p>\r\n<p><b>En son macOS yazılımı Mojave yi desteklemektedir.</b></p>', '7', '2', '111812', '21', '13203', NULL, NULL, 5450.00, 'USD', '{\"USD\":5450}', 0, 1, 5, 212, '40', '0', NULL, NULL, NULL, '2019-01-17 09:21:34', '2019-09-27 09:21:36', 'approved', 1, 0, '[]', 'files/images/1547716869508_macbook.jpg'),
(9, 9, '2019-01-17 09:22:54', 1, '2019-03-04 08:32:23', 1, NULL, 'karne_hediyesi_sorunsuz_temiz_26_jant_salcano_dag_bisikleti', '<p></p>\r\n<p>Merhabalar öncelikle herkese kolay gelsin. Ürün 21 Vites, 26 jant, V frendir. Resimlerde görüldüğü gibi olup yaşına göre temizdir. Öğrenci olduğumdan ilgilenemiyorum, kapalı alanda duruyor. Lastikler, frenler, vites sistemi iyi durumdadır. Hiç bir sorunu, problemi yok. Aksesuarsız verilecektir. Bin git durumda alana hayırlı olsun. Pazarlık payı yoktur. Lütfen pazarlık ve takas mesajı atıp kendinizi yormayın. Ciddi alıcılara gün içinde dönüş yaparım.</p>\r\n<p>-CST 2.10 Lastikler&nbsp;\r\n-Alüminyum Pedallar\r\n-Shimano Ön arttırıcı, arka arttırıcı ve kelebek vites kolları&nbsp;\r\n-Fren ayarları yapıldı.&nbsp;\r\n-Sele yaylı ile değiştirildi.\r\n-Kadro hasarsız temiz durumda.</p>', '7', '8', '3539', '5063', NULL, NULL, NULL, 369.00, 'USD', '{\"USD\":369}', 0, 1, 0, 212, '35', '1115', NULL, NULL, '39.11471332801274,27.178203017318197', '2019-01-17 09:22:54', '2019-09-27 09:22:56', 'approved', 0, 0, '[]', 'files/images/1547716969195_salcano3.jpeg'),
